import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import Wollu from "./Js/Wollu.js";
import AppDownloadView from './Js/AppDownloadView';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Wollu/>
  </React.StrictMode>
);

const wolluAppDownloadView = ReactDOM.hydrateRootcreateRoot(document.getElementById('WolluAppDownloadRoot'));
wolluAppDownloadView.render(
  <React.StrictMode>
    <AppDownloadView/>
  </React.StrictMode>
);
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
